import React from 'react';
import './Navbar.css';
import logo from '../ImagesLogo/logo1.jpeg';

function Navbar() {
  return (
    <div className='nav-bar'>
        <img src={logo} alt=''/>
        <ul className='nav-menu'>
          <li>Home</li>
          <li>About Me</li>
          <li>Education</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
        <div className="nav-connect">Connect</div>
    </div>
  )
}

export default Navbar;
